import notes from "../notes";
import Note from "./Note";
import Header from "./Header";
import Footer from "./Footer";

function App(){
    return (
        <div>
        <Header />
        {notes.map(noteItem =>
        <Note
            id={noteItem.id} 
            key={noteItem.key}
            title={noteItem.title}
            content={noteItem.content}
        />
    )}
        <Footer />
        </div>
        )
}
export default App;
